import React,{Component} from "react";
import { NavLink } from "react-router-dom";
function Navbar(){
    return(
        <div>
            <ul></ul>
        <NavLink to="/">Home</NavLink>
        <NavLink to="/about">About</NavLink>
        <NavLink to="/contact">Contact</NavLink>
        </div>
    );
}
export default Navbar;
